class FoodItem{
  final String id;
  final String imageUrl;
  final String category;
  final String name;
  final double price;
  final bool isFavorite;

  FoodItem( 
    {required this.id,
    required this.imageUrl,
    required this.category,
    required this.name,
    required this.price,
    this.isFavorite=false,
    }
    );
    FoodItem cobywith({bool? isFavorite}){
      return FoodItem(
        id: id, 
        imageUrl: imageUrl, 
        category: category, 
        name: name, 
        price: price,
        isFavorite: isFavorite??this.isFavorite
        );
    }
    


}

